    {
        EnsureMutable();
        var name = GetDisplayName(type);
        _ownedTypes ??= new Dictionary<string, ConfigurationSource>(StringComparer.Ordinal);

        if (_ownedTypes.TryGetValue(name, out var oldConfigurationSource))
